import React, { useEffect, useState } from "react";
import { useSearchParams } from "react-router-dom";
import axios from "axios";
import {
  Box,
  Typography,
  Grid,
  Checkbox,
  Divider,
  CircularProgress,
} from "@mui/material";

const ComparePage = () => {
  const [searchParams] = useSearchParams();
  const [car1, setCar1] = useState(null);
  const [car2, setCar2] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const id1 = searchParams.get("car1");
    const id2 = searchParams.get("car2");

    const fetchCars = async () => {
      try {
        const [res1, res2] = await Promise.all([
          axios.get(`http://localhost:8080/api/cars/${id1}`),
          axios.get(`http://localhost:8080/api/cars/${id2}`),
        ]);
        setCar1(res1.data);
        setCar2(res2.data);
      } catch (err) {
        console.error("Failed to fetch car details:", err);
      } finally {
        setLoading(false);
      }
    };

    fetchCars();
  }, [searchParams]);

  const renderRow = (label, key) => {
    const val1 = car1?.[key];
    const val2 = car2?.[key];
    const isEqual = val1 === val2;

    return (
      <Grid container spacing={2} alignItems="center" sx={{ py: 1 }}>
        <Grid item xs={12} md={3}>
          <Typography color="text.secondary">{label}</Typography>
        </Grid>

        <Grid item xs={12} md={4}>
          <Typography>{val1}</Typography>
          {isEqual && <Checkbox checked disabled />}
        </Grid>

        <Grid item xs={12} md={4}>
          <Typography>{val2}</Typography>
          {isEqual && <Checkbox checked disabled />}
        </Grid>
      </Grid>
    );
  };

  if (loading) return <CircularProgress sx={{ m: 5 }} />;
  if (!car1 || !car2) return <Typography m={5}>Car data not available.</Typography>;

  return (
    <Box p={4}>
      <Typography variant="h4" gutterBottom textAlign="center">
        üîç Car Comparison
      </Typography>

      <Grid container spacing={4} alignItems="center" justifyContent="center" sx={{ mb: 5 }}>
        <Grid item xs={12} md={5} textAlign="center">
          <Typography variant="h6">{car1.name}</Typography>
          <Typography variant="body2" color="text.secondary">{car1.type}</Typography>
          <img src={car1.imageUrl} alt={car1.name} style={{ width: "80%", marginTop: 8 }} />
        </Grid>

        <Grid item xs={12} md={5} textAlign="center">
          <Typography variant="h6">{car2.name}</Typography>
          <Typography variant="body2" color="text.secondary">{car2.type}</Typography>
          <img src={car2.imageUrl} alt={car2.name} style={{ width: "80%", marginTop: 8 }} />
        </Grid>
      </Grid>

      <Divider sx={{ mb: 4 }} />

      {/* Kar≈üƒ±la≈ütƒ±rƒ±lan √∂zellikler */}
      {renderRow("Engine", "engine")}
      {renderRow("Price", "price")}
      {renderRow("Type", "type")}
      {renderRow("Year", "year")}
      {renderRow("Transmission", "transmission")}
      {renderRow("Color", "color")}
      {renderRow("Km", "kilometers")}
    </Box>
  );
};

export default ComparePage;
